js = """
    var global_array = [
        {
            get first() {
                for(var i=0; i<100; i++) {
                    global_array.push(0x41);
                }
            }
        }
    ];

    // when accessed, the first element will make the array grow by 100 items.
    global_array;
    """
res = self.mr.eval(js)
self.assertEqual(res, [{'first': None}])
